import { Link, NavLink } from 'react-router-dom';
import PageContent from '../components/PageContent';

function HomePage() {
  return (
    <PageContent title="Welcome! page">
      <p>welcome page!</p>
      <button><NavLink to="/auth"></NavLink></button>
    </PageContent>
  );
}

export default HomePage;
